import {useNavigate} from 'react-router-dom';

function Book() {
    const history = useNavigate();
    localStorage.clear();
    useEffect(() => {
        if (window.localStorage.getItem('user-info') !== null) {
            history('/');
        }
    });
}

export default Book;
